  return <Box>
    <Box>
    <Contactchild/>
  </Box>
  <Box>
  <Image boxSize='200px' src='https://bit.ly/dan-abramov' alt='Dan Abramov' />
  </Box>
  </Box>
    // <div id="contact" style={{height:"800px"}}>
